import React, { useEffect, useState } from "react";
import axios from "axios";
import {
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBCardImage,
  MDBBtn,
  MDBCardHeader,
  MDBRipple,
  MDBRow,
  MDBCol,
} from "mdb-react-ui-kit";

function Book() {
  const [doctors, setDoctors] = useState([]);
  useEffect(() => {
    axios
      .get("/dataload")
      .then((response) => {
        setDoctors(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);
  return (
    <div className="App mt-4">
      const DataRows =
      <MDBRow>
        {doctors.map((doc) => (
          <div key={doc._id}>
            <MDBCol size="md">
              <MDBCard>
                <MDBCardHeader>Featured</MDBCardHeader>
                <MDBRipple
                  rippleColor="light"
                  rippleTag="div"
                  className="bg-image hover-overlay"
                >
                  <MDBCardImage src="" fluid alt="..." />
                  <a>
                    <div
                      className="mask"
                      style={{ backgroundColor: "rgba(251, 251, 251, 0.15)" }}
                    ></div>
                  </a>
                </MDBRipple>
                <MDBCardBody>
                  <MDBCardTitle>{doc.name}</MDBCardTitle>
                  <MDBCardText>{doc.message}</MDBCardText>
                  <MDBBtn href="#">Button</MDBBtn>
                </MDBCardBody>
              </MDBCard>
            </MDBCol>
          </div>
        ))}
      </MDBRow>
    </div>
  );
}
export default Book;
